import { Container, Label, Input } from "@theme-ui/components";

const CustomDomainInput = () => {
    return (
       <Container p='1em'>
           <Label variant='text.heading' sx={{fontSize: '0.625rem'}}>Add your custom domain</Label>
           <Input type='text' placeholder='www.logicowl.in'></Input>
       </Container>
    );
};

export default CustomDomainInput;
